def calArea(vlayer, typ):
    typ = 'Area '+ typ
    with edit(vlayer):
        for f in vlayer.getFeatures():
            aux = f.geometry().area() / 10000
            if not aux:
                f[typ] = 0.0
            else:
                f[typ] = aux
        vlayer.updateFeature(f)
        


    

def delAttr(vlayer, ind):   
    caps = vlayer.dataProvider().capabilities()
    if caps & QgsVectorDataProvider.DeleteAttributes:
        res = vlayer.dataProvider().deleteAttributes(ind)
    vlayer.updateFields()
    
def checkFile(vlayer):
    if not vlayer.isValid():
        print('no go')
    else:
        print('good to go')
        

def percLand(vlayer, typ):
    aux = 'Area '+typ
    index = QgsSpatialIndex(vlayer.getFeatures())
    caps = vlayer.dataProvider().capabilities()
    typi = "% "+ typ 
    if caps & QgsVectorDataProvider.DeleteFeatures:
        print('useful and removable')
        
    if caps & QgsVectorDataProvider.AddAttributes:
        res = vlayer.dataProvider().addAttributes(
            [QgsField(typi, QVariant.Double)])
    
    vlayer.updateFields()
    
    #exp1 = QgsExpression('"Area Parc"/"Area"')
    #exp2 = QgsExpression('"Area Asent"/"Area"')
    #exp3 = QgsExpression('"Area Comun"/"Area"')
    
    #contx = QgsExpressionContext()
    #contx.appendScopes(QgsExpressionContextUtils.globalProjectLayerScopes(vlayer))
    
    with edit(vlayer):
        for f in vlayer.getFeatures():
            #contx.setFeature(f)
            if typ =="Parc":
                if f[(aux+'_')]!=NULL:
                    f[typi] = f[(aux+'_')]/f['Area Eje']
                else:
                    f[typi] = 0.0
            elif typ=="Comun":
                if f[aux]!= NULL:
                    f[typi] = f[aux]/f['Area Eje']
                else:
                    f[typi] = 0.0
            else:
                if f[aux]!=NULL:
                    f[typi] = f[aux]/f['Area Eje']
                else:
                    f[typi] = 0.0
            
            vlayer.updateFeature(f)
            
            

