def countIntr(vlayer, jlayer, request):
    req = QgsFeatureRequest().setFilterExpression(request)
    index = QgsSpatialIndex(jlayer.getFeatures(req))
    count = 0
    for f in vlayer.getFeatures():
        ides = index.intersects(f.geometry().boundingBox())
        count = count + len(ides)
    return count



def featIntrID(vlayer, jlayer, request):
    req = QgsFeatureRequest().setFilterExpression(request)
    index = QgsSpatialIndex(jlayer.getFeatures(req))
    res = []
    for f in vlayer.getFeatures():
        ides = index.intersects(f.geometry().boundingBox())
        for ids in ides:
            res.append(ids)
    return res

def fillIntArea(feature, index, jlayer):
    ides = index.intersects(feature.geometry().boundingBox())
    if len(ides) > 0:
        res = 0
        for ids in ides:
            res = res + interArea(feature, jlayer.getFeature(ids))
        return res
    else:
        return 0.0

    



def setCountFrst(vlayer, jlayer, request, typo):
    req = QgsFeatureRequest().setFilterExpression(request)
    index = QgsSpatialIndex(jlayer.getFeatures(req))
    with edit(vlayer):
        for f in vlayer.getFeatures():
            ides = index.intersects(f.geometry().boundingBox())
            aux = len(ides)
            for ids in ides:
                if 'ESPINOSA' in jlayer.getFeature(ids)['TIP_ECOV']:
                    aux = aux - 1
            f[typo] = aux
            vlayer.updateFeature(f)

        
def setArFrst(vlayer, jlayer, request, typo):
    # req = QgsFeatureRequest().setFilterExpression(request)
    index = QgsSpatialIndex(jlayer.getFeatures())
    with edit(vlayer):
        for f in vlayer.getFeatures():
            f[typo] = fillIntArea(f, index, jlayer)
            vlayer.updateFeature(f)
            
        

def countFeatIns(vlayer, request):
    req = QgsFeatureRequest().setFilterExpression(request)
    m = 0
    for f in vlayer.getFeatures(req):
        m += 1
    return m
    
def setUpField(vlayer, typ):
    index = QgsSpatialIndex(vlayer.getFeatures())
    caps = vlayer.dataProvider().capabilities()

    if caps & QgsVectorDataProvider.DeleteFeatures:
        print('useful and removable')
        
    if caps & QgsVectorDataProvider.AddAttributes:
        res = vlayer.dataProvider().addAttributes(
            [QgsField(typ, QVariant.Double)])
    
    vlayer.updateFields()
    
def interCount(polyg, point):
    if point.geometry().within(polyg.geometry()):
        return 1
    else:
        return 0

def fillIntCount(feature, index, jlayer):
    # index = QgsSpatialIndex(jlayer.getFeatures(QgsFeatureRequest().setFilterExpression(request)))
    ides = index.intersects(feature.geometry().boundingBox())
    if not len(ides) == 0:
        res = 0
        for ids in ides:
            res = res + interCount(feature, jlayer.getFeature(ids))
        return res
    else:
        return 0
    

def setMinCount(vlayer, jlayer, request, typo):
    index = QgsSpatialIndex(jlayer.getFeatures(QgsFeatureRequest().setFilterExpression(request)))
    with edit(vlayer):
        for f in vlayer.getFeatures():
            f[typo] = fillIntCount(f, index, jlayer)
            vlayer.updateFeature(f)
            

